import React, { Component } from "react";
import Navigation from "../components/Navigation";
import Projects from "../components/Projects";

class Knowledges extends Component {
  state = {
    languages: [
      { id: 2, techno: "HTML", xp: 0.98 },
      { id: 3, techno: "SCSS", xp: 1 },
      { id: 1, techno: "Javascript", xp: 2 },
      { id: 4, techno: "Bootstrap", xp: 2 }
    ]
  };
  render() {
    let { languages } = this.state;
    return (
      <>
        <Navigation />
        <div className="col-xl">
          <h1 className="profile display-4 fw-bolder">Knowledges</h1>
          <Projects languages={languages} title="Languages" />
        </div>
      </>
    );
  }
}

export default Knowledges;
